Beretta Shotgun Collectors Skeet Set Model S682, S/N R12341B,  in case with cleaning tools and four over/under shotgun barrels. The set was manufactured in Italy at Gardone V.T. and imported by New York’s  Berben Corp more than 40 years ago. The set features a detachable front grip and stock and the following four barrels [Excelsior High Strength Alloyed Steel stamped KG1520]:
•	12 ga., 2 & 3/4 inches, 28 inches long;
•	20 ga., 2 & 3/4 inches, 28 inches long;
•	28 ga., 2 & 3/4 inches, 28 inches long;
•	410 ga., 2 & 3/4 inches, 28 inches long.
The set is enclosed in a custom case which includes shotgun cleaning gear, rod and brushes.
Cash only, no trades. $75 shipping credit from my FFL to yours.[img]beretta model 682 001 - Copy[/img]
